import React from 'react'
import Logo from "../img/logo.png"

const Footer = () => {
  return (
    <div className='footer'>
      <img src={Logo} alt="" />
      <span>Made with <b>Miss.Phhanthila Chairakwong</b></span>
    </div>
  )
}

export default Footer
